    Backstory:
      "Llew was kept sequestered most of his life, because it was clear early on that he was not the brightest candle in the keep. He did, however, have a knack for physical movement, and he studied daily with a monk brought on as a retainer.\n\nUpon coming of age, Llew resented staying inside, and left the estate more often -- usually without telling anyone because he was easily convinced to stay if his family tried to keep him back. \n\nHe has a few haunts in the town and now hears news of the world at large. He doesn't follow the politics well, but he wants to be part of doing things.",
    'Feat+Traits':
      "Everyone knows Llew is genial but dumb, even Llew. He resents his slowness of thought, and tries to make up for it with skill. He often shows off, but doesn't pick on anyone to do it, which means mostly showing his awesome kicks and spins and flips. \n\nLlew, unfortunately, does not keep his tongue in check. Though often ignorant, he still speaks. He has, on occasion made commitments for his family they didn't want to make. He tries not to do that now, but his siblings, especially, are much more shamed by his behavior than is truly warranted.",
