    FactionName: '',
    Backstory:
      "Nadash spent his adolescence in the libraries of Silverymoon. Despite his terror of socialization, Nadash was likable and was given supervised access to most of the temples in the city, including those in temples, though some had more restrictions than others. \n\nOne day he made a connection between an ancient scroll in the Vault of Sages to a small, disregarded chart in the Map House. The implications were horrific. Worse, he doubted he would be believed. He immediately began a journey to gather the evidence he would need to get the attention the issue warranted. \n\nHis journey took him to Timberlin, where he made friends with a gnome druid called Gekgek. Gekgek gave Nadash far more insight and understanding into his problem than Gekgek would even understand -- so he took a risk and told his new friend what he was doing.\n\nNadash also said he needed to leave Timberlin soon, and to his surpsie, Gekgek immediately decided to accompany him.\n\nThe human ranger, Chennen Genseldotter, also a resident of Timberlin, inserted herself into the party. She had a decades old relationship with Gekgek, Nadash barely knew her. Chennen claimed that she felt responsible for Gekgek's safety, so Nadash agreed to her company.",
