      "Summon an obedient celestial, fey, or fiend animal that disappears when it reaches 0 hp oor is dismissed.\n100' Telepathy with you. You can use familiar's eyes and ears as an action. Familiar can deliver a spell with range of touch as it's action.",
    'SpellSheet1_Spell Name 07': 'Identify',
    'SpellSheet 1_Spells Level 07': 1,
    'SpellSheet1_Spell School 07': 'divination',
    'SpellSheet1_Range 07': 'touch',
    'SpellSheet1_Casting Time 07': '1 min',
    'SpellSheet1_Ritual 07': 'Yes',
    'SpellSheet1_Save 07': '-',
    'SpellSheet1_Duration 07': 'instant',
    'SpellSheet1_Concentration 07': 'Off',
    'SpellSheet1_Components 07': 'pearl and owl feather',
    'SpellSheet1_Verbal 07': 'Yes',
    'SpellSheet1_Somatic 07': 'Yes',
    'SpellSheet1_Material 07': 'Yes',
    'SpellSheet1_Prepared 07': 'Off',
    'SpellSheet1_Spell Effect 07':
      'You choose one object that you must touch throughout the casting of the spell. If it is a magic item or some other magic-imbued object, you learn its properties and how to use them, whether it requires attunement to use, and how many charges it has, if any. You learn whether any spells are affecting the item and what they are. If the item w as created by a spell, you learn which spell created it.\nIf you instead touch a creature throughout the casting, you learn what spells, if any, are currently affecting it.',
    'SpellSheet1_Spell Name 08': 'Magic Missle',
    'SpellSheet 1_Spells Level 08': 1,
    'SpellSheet1_Spell School 08': 'evocation',
    'SpellSheet1_Range 08': "120'",
    'SpellSheet1_Casting Time 08': '1 action',
    'SpellSheet1_Ritual 08': 'Off',
    'SpellSheet1_Save 08': '-',
    'SpellSheet1_Duration 08': 'instant',
    'SpellSheet1_Concentration 08': 'Off',
    'SpellSheet1_Components 08': '',
    'SpellSheet1_Verbal 08': 'Yes',
    'SpellSheet1_Somatic 08': 'Yes',
    'SpellSheet1_Material 08': 'Off',
    'SpellSheet1_Prepared 08': 'Yes',
    'SpellSheet1_Spell Effect 08':
      'You create three glowing darts o f magical force. Each\ndart hits a creature o f your choice that you can see\nwithin range. A dart deals 1d4 + 1 force damage to its\ntarget. The darts all strike simultaneously, and you can\ndirect them to hit one creature or several.\nAt Higher Levels. When you cast this spell using a\nspell slot of 2nd level or higher, the spell creates one\nmore dart for each slot level above 1st.',
    'SpellSheet1_Spell Name 09': 'Thunderwave',
    'SpellSheet 1_Spells Level 09': 1,
    'SpellSheet1_Spell School 09': 'evocation',
    'SpellSheet1_Range 09': 'self',
    'SpellSheet1_Casting Time 09': '1 action',
    'SpellSheet1_Ritual 09': 'Off',
    'SpellSheet1_Save 09': 'Con',
    'SpellSheet1_Duration 09': 'instant',
    'SpellSheet1_Concentration 09': 'Off',
    'SpellSheet1_Components 09': '',
    'SpellSheet1_Verbal 09': 'Yes',
    'SpellSheet1_Somatic 09': 'Yes',
    'SpellSheet1_Material 09': 'Off',
    'SpellSheet1_Prepared 09': 'Yes',
    'SpellSheet1_Spell Effect 09':
      'A wave o f thunderous force sweeps out from you. Each creature in a 15-foot cube originating from you must make a Constitution saving throw. On a failed save, a creature takes 2d8 thunder damage and is pushed 10 feet away from you. On a successful save, the creature takes half as much damage and isnt pushed.\nIn addition, unsecured objects that are completely within the area o f effect are automatically pushed 10 feet away from you by the spells effect, and the spell emits a thunderous boom audible out to 300 feet.\nWhen you cast this spell using a spell slot of 2nd level or higher, the damage increases by 1d8 for each slot level above 1st',
