    Backstory:
      "Geherit got into bounty hunting because he figured it was the least amount of work for the most gold, not realizing how much time it takes to track people down. His lack of melee skills hurt when it came time for him to actually tackle and cuff the bounty, but a professional bounty hunter with more skill, Candal Breeze, took notice of him and tried to train him in the Way of the Bounty.\n\nGeherit struggled to make the lessons stick. His mentor finally told him he was ready for a bigger target, and sent him off into the world to bring in one a bounty Candal didn't think he had any chance of catching, and will likely get him killed if he goes in alone. \n\nHe was part right. Geherit didn't die, but he definitely missed that bounty. He decided then he would never miss fail a job again. He has trouble working with other still, but he knows it's a skill he needs.",
