      'Tiffany was an apt pupil. She learned everything in her lessons and excelled, especially in history, which she loved. She also participated in competitions, including the mock sword duels with her siblings.\n\nUnfortunately, while she could recite facts and information on demand, she never had any idea how any of that knowledge could be used. \n\nTiffany grew up as the definition of idle rich. Her family never involved her in any decisions. However, they gave her anything she ever asked for, especially when she presented a facial expression her brothers came to call "princes eyes." She learned to entertain herself with up close magic, including picking pockets. \n\nLast year, while Tiffany was in Waterdeep visiting friends of the family, disease struck the family, and her parents, aunts and uncles, and older siblings all passed. Tiffany is now the head of the household, and of course doesn\'t understand how to do anything. Combined with her frivolous nature, even Tiffany is worried she\'ll destroy the family.',
