    'Features and Traits':
      "* Darkvision 60'\n* Gnome Cunning\n ** advantage on Int, Wis, & Cha saves\n* Natural Illusionist\n ** can cast minor illusion cantrip, DC 13\n* Speak with small beasts\n* Expertise\n ** Thieves' Tools\n ** Investigation\n* Sneak Attack 1d6\n* Business: Calligraphy\n* Guild Membership",
