    Backstory:
      "Sulfika grew up in a family of avid gardeners and horticulturists. Not farmers, really, but the majority of what they ate they grew themselves, and family gatherings were always discussions of each other's vegetable plots and flower beds. This plant obsession of her family earned her two of her names, as comparisons to the plants.\n\nSulfika was only mildly interested in plants, and mostly how she could use them in ink dyes. She excelled at calligraphy, however, and was often asked to paint signs for gardens.\n\nSulfika fell in love with a gnomish girl from a family living on an estate near her own. They weren't nobility, but were certainly wealthy, and had made their money in trade and shipping. Genda appeared to have feelings for Sulfika as well, but due to Sulfika's rustic family, Genda's parents disapproved. They forbade Genda from associating with Sulfika. The two lovers met in clandestine manner for another 2 years, until they were caught. The family threatened to kill Sulfika and ruin her family if they didn't break it off. Sulfika still wanted to risk it, but Genda couldn't bear to be the cause of such trouble, and ended their relationship.\n\nMore cynical and bitter now, Sulfika threw herself into her work, becoming even more expert in calligraphy, but also in her skills of stealth, particularly how to hurt people if necessary. She keeps tabs on her old flame and makes sure she does well. Her heart still aches when she sees Genda.",
