      "Darkvision 60'\nGnome Cunning\n* advantage on Int, Wis, Cha saves\nNatural Illusionist\n* minor illusion\nSpeak with Small Beasts\nSorcerous Origin: Wild Magic\n* Wild Magic Surge\n* Tides of Chaos\n ** adv on one save, check, or attack roll\nFavored Scheme: selling useless junk as priceless objects\nFalse Identity - an accomplished sage/scholar with great authority.\nForge documents",
    Age: '200',
    Height: '3\'6"',
    Weight: '43',
    Eyes: 'purple',
