    FactionName: '',
    Backstory:
      "No one every understood Namfoodle. But that's part of how he became a successful con artist. \n\nNamfoodle enjoyed that success. He liked the money, but even more the feeling when he deceived someone -- like he was shaping their reality.\n\nBut it wasn't enough. Namfoodle wasn't sure what else he need. More ability to shape the world. But how?\n\nThe answer came at a fair. The carnie was making a take of viscous glowing green goop move around. It wasn't green slime -- the texture and shade were wrong. And it was definitely magic, because the carnie sure wasn't. \n\nWithout hesitating, Namfoodle ran forward, dodging security, and dove into the tank. As he suffocated, he tried to send his thoughts out, to make the ooze bend to his will.\n\nJust before it was too late, something listened. In a great rush the magic left the goop and entered Namfoodle. After which he was removed from the tank, roughed up, and ejected from the fair.\n\nNow Namfoodle seeks even more ways to shape and control the world.",
    'Feat+Traits':
      'Namfoodle continues to nag the strangers he challenges until he is forcibly stopped or they accept the challenge.\nIf they complete the challenge, they earn his undying respect and his friendship.',
