    'SpellSheet1_Spell Effect 02':
      "You hurl a mote of fire at a creature or object within range. Make a ranged spell attack against the target. On a hit, the target takes 1d10 fire damage. A flammable object hit by this spell ignites if it isn't being worn or carried.\nThis spells damage increases by 1d10 when you reach 5th level (2d10), 11th level (3d10), and 17th level (4d10).",
