    'Features and Traits':
      "* Artificer's Lore\n* Tinker\n* Darkvision 60'\n* Gnome Cunning\n ** adv on Int, Wis, & Cha saves\n* Patron - Mechanix\n* Smarter Than You\n* Goggles of Mechanix:\n ** bonus to tool checks\n ** advantage on tech related skill checks\n ** disadvantage on interaction skill checks\n* Skilled feat\n* Keen Mind feat",
    Age: '42',
