    Weight: '39',
    Eyes: 'brown',
    Skin: 'bronze',
    Hair: 'honey-red',
    Allies: '',
    FactionName: '',
    Backstory:
      'Generally Daedalus has three modes of behavior. One, planning to create, invent, or assemble something. Two, putting that plan into action. Three, puttering, which involves disassembling things or attaching other random things to each other to see if/how they fit.\n\nDaedalus has behaved this way since he was a small child, which seems normal for a rock gnome, but Daedalus was obsessed. So much so that soon after reaching adulthood, Mechanix took notice of him, and manifested with an offer to be his patron. After the pact was sealed, Mechanix ordered Daedalus into the world, where he would later receive further instructions.\n',
    'Feat+Traits':
      'Daedalus wears glasses that make his eyes look huge. The Goggles of Mechanix enhance the effect even more. His clothes and hair are usually slightly disheveled, and his shirt and pants often have grease stains or small tears. ',
