    'SpellSheet1_Prepared 03': 'Yes',
    'SpellSheet1_Spell Effect 03':
      "This spell creates an invisible, mindless, shapeless\nforce in an unoccupied space on the ground within range. It has AC 10, 1 hit point, and a Strength o f 2, and it cant attack. If it drops to 0 hit points, the spell ends.\nOnce per turn use a bonus action to command the servent to move 15' and interact with an object. The servant can perform simple tasks a human servant could do. The servant performs the task to the best of its ability until complete, then waits for your next command.\nIf you command the servant to perform a task that movies it more than 60' away from you, the spell ends.",
