    'SpellSheet1_Spell Effect 04':
      'A sustained arc of lightning between you and the target. Make a ranged spell attack against that creature. On a hit, the target takes 1d12 lightning damage, and on each of your turns for the duration, you can use your action to deal 1d12 lightning damage to the target automatically. The spell ends if you use your action to do anything else or if the target is ever outside the spells range or has total cover from you.\nWhen you cast this spell using a higher level spell slot , the initial damage increases by 1d12 for each slot level above 1st.',
