      "When Felliwin was young, a copy of the OGL D20 Modern game by Wizards of the Coast fell through a warp, along with a bag of dice. Though they were soon lost, this inspired her abiding interest in polyhedrals. She learned the jeweler's trade so she could recreate the shapes in the dice, and invent her own.\n\nFelliwin is not a successful jeweler. There isn't enough interest in her unique style to earn a living. To that end, she has taken up adventuring to earn money for supplies.\n",
    'Feat+Traits':
      'full name: Filliwin Mondilocan Fallbreta Dodae Icosa Hedra Modressa Prisma Trapezia Pollyrhom Fellilandria Goldiwick\nShe would love to explain the origin and meaning of each name.\n\nFelliwin wears her own jewelry -- mostly interesting stones carved into regular 3-d shapes and made into hair pins',
