    'SpellSheet1_Spell Effect 01':
      'You hurl a bubble of acid. Choose one creature within range, or choose two creatures within range that are within 5 feet of each other. A target must succeed on a Dexterity saving throw or take 1d6 acid damage.\nThis spells damage increases by 1d6 when you reach\n5th level (2d6), 11th level (3d6), and 17th level (4d6).',
    'SpellSheet1_Spell Name 02': 'Chill Touch',
    'SpellSheet 1_Spells Level 02': '0',
    'SpellSheet1_Spell School 02': 'necromancy',
    'SpellSheet1_Range 02': "120'",
    'SpellSheet1_Casting Time 02': '1 action',
    'SpellSheet1_Ritual 02': 'Off',
    'SpellSheet1_Save 02': '-',
    'SpellSheet1_Duration 02': '1 round',
    'SpellSheet1_Concentration 02': 'Off',
    'SpellSheet1_Component 02': '',
    'SpellSheet1_Verbal 02': 'Yes',
    'SpellSheet1_Somatic 02': 'Yes',
    'SpellSheet1_Material 02': 'Off',
    'SpellSheet1_Prepared 02': 'Yes',
    'SpellSheet1_Spell Effect 02':
      'You create a ghostly, skeletal hand in the space of a creature within range. Make a ranged spell attack against the creature to assail it with the chill of the grave. On a hit, the target takes 1d8 necrotic damage, and it cant regain hit points until the start of your next turn. Until then, the hand clings to the target.\nIf you hit an undead target, it also has disadvantage on attack rolls against you until the end of your next turn.\nThis spells damage increases by 1d8 when you reach 5th level (2d8), 11th level (3d8), and 17th level (4d8).',
    'SpellSheet1_Spell Name 03': 'Fire Bolt',
    'SpellSheet 1_Spells Level 03': '0',
    'SpellSheet1_Spell School 03': 'evocation',
    'SpellSheet1_Range 03': "120'",
    'SpellSheet1_Casting Time 03': '1 action',
    'SpellSheet1_Ritual 03': 'Off',
    'SpellSheet1_Save 03': '-',
