    'SpellSheet1_Verbal 03': 'Yes',
    'SpellSheet1_Somatic 03': 'Yes',
    'SpellSheet1_Material 03': 'Off',
    'SpellSheet1_Prepared 03': 'Yes',
    'SpellSheet1_Spell Effect 03':
      "You hurl a mote o f fire at a creature or object within range. Make a ranged spell attack against the target. On a hit, the target takes 1d10 fire damage. A flammable object hit by this spell ignites if it isn't being worn or carried.\nThis spells damage increases by 1d10 when you reach 5th level (2d10), 11th level (3d10), and 17th level (4d10)",
    'SpellSheet1_Spell Name 04': 'Chromatic Orb',
    'SpellSheet 1_Spells Level 04': '1',
    'SpellSheet1_Spell School 04': 'evocation',
    'SpellSheet1_Range 04': "90'",
    'SpellSheet1_Casting Time 04': '1 action',
    'SpellSheet1_Ritual 04': 'Off',
    'SpellSheet1_Save 04': '-',
    'SpellSheet1_Duration 04': 'instant',
    'SpellSheet1_Concentration 04': 'Off',
    'SpellSheet1_Components 04': '50gp diamond',
    'SpellSheet1_Verbal 04': 'Yes',
    'SpellSheet1_Somatic 04': 'Yes',
    'SpellSheet1_Material 04': 'Yes',
    'SpellSheet1_Prepared 04': 'Yes',
    'SpellSheet1_Spell Effect 04':
      'You hurl a 4-inch-diameter sphere of energy at a creature that you can see within range. You choose acid, cold, fire, lightning, poison, or thunder for the type of orb you create, and then make a ranged spell attack against the target. If the attack hits, the creature takes 3d8 damage o f the type you chose.\nAt Higher Levels. When you cast this spell using a spell slot o f 2nd level or higher, the damage increases by 1d8 for each slot level above 1st.',
    'SpellSheet1_Spell Name 05': 'Detect Magic',
    'SpellSheet 1_Spells Level 05': '1',
    'SpellSheet1_Spell School 05': 'divination',
    'SpellSheet1_Range 05': 'self',
    'SpellSheet1_Casting Time 05': '1 action',
    'SpellSheet1_Ritual 05': 'Off',
    'SpellSheet1_Save 05': '-',
    'SpellSheet1_Duration 05': '10 min',
    'SpellSheet1_Concentration 05': 'Yes',
    'SpellSheet1_Components 05': '',
    'SpellSheet1_Verbal 05': 'Yes',
    'SpellSheet1_Somatic 05': 'Yes',
    'SpellSheet1_Material 05': 'Off',
    'SpellSheet1_Prepared 05': 'Yes',
    'SpellSheet1_Spell Effect 05':
      'For the duration, you sense the presence of magic within 30 feet o f you. If you sense magic in this way, you can use your action to see a faint aura around any visible creature or object in the area that bears magic, and you learn its school of magic, if any.\nThe spell can penetrate most barriers, but it is blocked by 1 foot of stone, 1 inch of common metal, a thin sheet of lead, or 3 feet of wood or dirt.',
    'SpellSheet1_Spell Name 06': 'Feather Fall',
    'SpellSheet 1_Spells Level 06': 1,
    'SpellSheet1_Spell School 06': 'transmutation',
    'SpellSheet1_Range 06': "60'",
    'SpellSheet1_Casting Time 06': '1 reaction',
    'SpellSheet1_Ritual 06': 'Off',
    'SpellSheet1_Save 06': '-',
    'SpellSheet1_Duration 06': '1 min',
    'SpellSheet1_Concentration 06': 'Off',
    'SpellSheet1_Components 06': 'small feather',
    'SpellSheet1_Verbal 06': 'Yes',
    'SpellSheet1_Somatic 06': 'Off',
    'SpellSheet1_Material 06': 'Yes',
    'SpellSheet1_Prepared 06': 'Yes',
    'SpellSheet1_Spell Effect 06':
      "Choose up to five falling creatures within range. A falling creature's rate o f descent slows to 60 feet per round until the spell ends. If the creature lands before the spell ends, it takes no falling damage and can land on its feet, and the spell ends for that creature.",
    'SpellSheet1_Spell Name 07': 'Find Familiar',
    'SpellSheet 1_Spells Level 07': 1,
