    'SpellSheet1_Concentration 07': 'Off',
    'SpellSheet1_Components 07': 'charcoal, incense, herbs',
    'SpellSheet1_Verbal 07': 'Yes',
    'SpellSheet1_Somatic 07': 'Yes',
    'SpellSheet1_Material 07': 'Yes',
    'SpellSheet1_Prepared 07': 'Yes',
    'SpellSheet1_Spell Effect 07':
      "Summon an obedient celestial, fey, or fiend animal that disappears when it reaches 0 hp oor is dismissed.\n100' Telepathy with you. You can use familiar's eyes and ears as an action.\nFamiliar can deliver a spell with range of touch as it's action.",
    'SpellSheet1_Spell Name 08': 'Magic Missile',
    'SpellSheet 1_Spells Level 08': 1,
    'SpellSheet1_Spell School 08': 'evocation',
    'SpellSheet1_Range 08': "120'",
    'SpellSheet1_Casting Time 08': '1 action',
    'SpellSheet1_Ritual 08': 'Off',
    'SpellSheet1_Save 08': '-',
    'SpellSheet1_Duration 08': 'instant',
