    'SpellSheet1_Verbal 08': 'Yes',
    'SpellSheet1_Somatic 08': 'Yes',
    'SpellSheet1_Material 08': 'Off',
    'SpellSheet1_Prepared 08': 'Yes',
    'SpellSheet1_Spell Effect 08':
      'You create three glowing darts o f magical force. Each dart hits a creature o f your choice that you can see within range. A dart deals 1d4 + 1 force damage to its target. The darts all strike simultaneously, and you can direct them to hit one creature or several.\nAt Higher Levels. When you cast this spell using a spell slot of 2nd level or higher, the spell creates one more dart for each slot level above 1st.',
    'SpellSheet1_Spell Name 09': 'Witch Bolt',
    'SpellSheet 1_Spells Level 09': 1,
    'SpellSheet1_Spell School 09': 'evocation',
    'SpellSheet1_Range 09': "30'",
    'SpellSheet1_Casting Time 09': '1 action',
