    'SpellSheet1_Components 09': 'twig from lightning strucktree',
    'SpellSheet1_Verbal 09': 'Yes',
    'SpellSheet1_Somatic 09': 'Yes',
    'SpellSheet1_Material 09': 'Yes',
    'SpellSheet1_Prepared 09': 'Yes',
    'SpellSheet1_Spell Effect 09':
      'A beam of crackling, blue energy lances out toward a creature within range, forming a sustained arc of lightning between you and the target. Make a ranged spell attack against that creature. On a hit, the target takes 1d12 lightning damage, and on each of your turns for the duration, you can use your action to deal 1d12 lightning damage to the target automatically. The spell ends if you use your action to do anything else. The spell also ends if the target is ever outside the spells range or\nif it has total cover from you.\nAt Higher Levels. When you cast this spell using a spell slot o f 2nd level or higher, the initial damage increases by 1d12 for each slot level above 1st.',
