      "Fine clothes\nSignet ring\nScroll of pedigree\nScimitar\nHandaxe (2)\nExplorer's Pack\nJavelin (4)\nShield\nBattleaxe\nFake scroll of pedigree showing my descent from dark, brooding people from history and legend, poorly made\nA diary written in an unknown language",
    'Features and Traits':
      "* Darkvision 60'\n* Fey Ancestry\n** immune to magic sleep\n** advantage on save v charm\n* Rage\n** advantage on strength checks and save\n** +2 melee damage\n** resistance to bps damage\n** 1 minute\n** 2 uses\n** Recites his own emo poetry the whole time\n* Unarmored Defense\n* Position of Privilege",
    Age: '21',
    Height: '5\'3"',
    Weight: '122#',
    Eyes: 'Gray',
    Skin: 'Black',
    Hair: 'extremely fair',
    Allies: '',
    FactionName: '',
