    'SpellSheet1_Verbal 01': 'Off',
    'SpellSheet1_Somatic 01': 'Yes',
    'SpellSheet1_Material 01': 'Yes',
    'SpellSheet1_Prepared 01': 'Yes',
    'SpellSheet1_Spell Effect 01':
      'For the duration, you have advantage on all Charisma\nchecks directed at one creature of your choice that isnt hostile toward you. When the spell ends, the creature realizes that you used magic to influence its mood and becomes hostile toward you. A creature prone to violence might attack you. Another creature might seek retribution in other ways (at the DMs discretion), depending on the nature of your interaction with it.',
    'SpellSheet1_Spell Name 02': 'Mage Hand',
    'SpellSheet 1_Spells Level 02': '0',
    'SpellSheet1_Spell School 02': 'conjuration',
    'SpellSheet1_Range 02': "30'",
    'SpellSheet1_Casting Time 02': '1 action',
    'SpellSheet1_Ritual 02': 'Off',
    'SpellSheet1_Save 02': '-',
    'SpellSheet1_Duration 02': '1 min',
    'SpellSheet1_Concentration 02': 'Off',
    'SpellSheet1_Component 02': '',
    'SpellSheet1_Verbal 02': 'Yes',
    'SpellSheet1_Somatic 02': 'Yes',
    'SpellSheet1_Material 02': 'Off',
    'SpellSheet1_Prepared 02': 'Yes',
    'SpellSheet1_Spell Effect 02':
      'A spectral, floating hand appears at a point you choose within range. The hand lasts for the duration or until you dismiss it as an action. The hand vanishes if it is ever more than 30 feet away from you or if you cast this spell again.\nYou can use your action to control the hand. You can use the hand to manipulate an object, open an unlocked door or container, stow or retrieve an item from an open container, or pour the contents out o f a vial. You can move the hand up to 30 feet each time you use it.\nThe hand cant attack, activate magic items, or carry more than 10 pounds.',
    'SpellSheet1_Spell Name 03': 'Charm Person',
    'SpellSheet 1_Spells Level 03': '1',
    'SpellSheet1_Spell School 03': 'enchantment',
    'SpellSheet1_Range 03': "30'",
    'SpellSheet1_Casting Time 03': '1 action',
    'SpellSheet1_Ritual 03': 'Off',
    'SpellSheet1_Save 03': 'Wis',
    'SpellSheet1_Duration 03': '1 hour',
    'SpellSheet1_Concentration 03': 'Off',
    'SpellSheet1_Components 03': '',
    'SpellSheet1_Verbal 03': 'Yes',
    'SpellSheet1_Somatic 03': 'Yes',
    'SpellSheet1_Material 03': 'Off',
    'SpellSheet1_Prepared 03': 'Yes',
    'SpellSheet1_Spell Effect 03':
      'You attempt to charm a humanoid you can see within range. It must make a W isdom saving throw, and does so with advantage if you or your companions are fighting it. If it fails the saving throw, it is charmed by you until the spell ends or until you or your companions do anything harmful to it. The charmed creature regards you as a friendly acquaintance. When the spell ends, the creature knows it w as charmed by you.\nAt Higher Levels. When you cast this spell using\na spell slot o f 2nd level or higher, you can target one additional creature for each slot level above 1st. The creatures must be within 30 feet of each other when you target them.',
    'SpellSheet1_Spell Name 04': 'Cure Wounds',
    'SpellSheet 1_Spells Level 04': '1',
    'SpellSheet1_Spell School 04': 'evocation',
    'SpellSheet1_Range 04': 'touch',
    'SpellSheet1_Casting Time 04': '1 action',
    'SpellSheet1_Ritual 04': 'Off',
    'SpellSheet1_Save 04': '-',
    'SpellSheet1_Duration 04': 'instant',
    'SpellSheet1_Concentration 04': 'Off',
    'SpellSheet1_Components 04': '',
    'SpellSheet1_Verbal 04': 'Yes',
    'SpellSheet1_Somatic 04': 'Yes',
    'SpellSheet1_Material 04': 'Off',
    'SpellSheet1_Prepared 04': 'Yes',
    'SpellSheet1_Spell Effect 04':
      'A creature you touch regains a number of hit points equal to 1d8 + your spellcasting ability modifier. This spell has no effect on undead or constructs.\nAt Higher Levels. When you cast this spell using a spell slot o f 2nd level or higher, the healing increases by 1d8 for each slot level above 1st.',
    'SpellSheet1_Spell Name 05': 'Feather Fall',
    'SpellSheet 1_Spells Level 05': '1',
    'SpellSheet1_Spell School 05': 'transmutation',
    'SpellSheet1_Range 05': "60'",
    'SpellSheet1_Casting Time 05': '1 reaction',
    'SpellSheet1_Ritual 05': 'Off',
    'SpellSheet1_Save 05': '-',
    'SpellSheet1_Duration 05': '1 min',
    'SpellSheet1_Concentration 05': 'Off',
    'SpellSheet1_Components 05': 'small feather',
    'SpellSheet1_Verbal 05': 'Yes',
    'SpellSheet1_Somatic 05': 'Off',
    'SpellSheet1_Material 05': 'Yes',
    'SpellSheet1_Prepared 05': 'Yes',
    'SpellSheet1_Spell Effect 05':
      "Choose up to five falling creatures within range. A falling creature's rate of descent slows to 60 feet per round until the spell ends. If the creature lands before the spell ends, it takes no falling damage and can land on its feet, and the spell ends for that creature",
    'SpellSheet1_Spell Name 06': 'Sleep',
    'SpellSheet 1_Spells Level 06': 1,
    'SpellSheet1_Spell School 06': 'enchantment',
    'SpellSheet1_Range 06': "90'",
    'SpellSheet1_Casting Time 06': '1 action',
    'SpellSheet1_Ritual 06': 'Off',
    'SpellSheet1_Save 06': '-',
    'SpellSheet1_Duration 06': '1 min',
    'SpellSheet1_Concentration 06': 'Off',
    'SpellSheet1_Components 06': 'pinch of sand',
    'SpellSheet1_Verbal 06': 'Yes',
    'SpellSheet1_Somatic 06': 'Yes',
    'SpellSheet1_Material 06': 'Yes',
    'SpellSheet1_Prepared 06': 'Yes',
    'SpellSheet1_Spell Effect 06':
      'This spell sends up to 5d8 hit points of creatures within a point you choose within range into a magical slumber. Creatures are affected in ascending order of current hit points (ignoring unconscious creatures). The creature falls asleep until the spell ends, the sleeper takes\ndamage, or someone uses an action to shake or slap the\nsleeper awake.\nUndead and creatures immune to being charmed arent affected by this spell.\nAt Higher Levels. When you cast this spell using a spell slot o f 2nd level or higher, roll an additional 2d8 for each slot level above 1st.',
