    'SpellSheet1_Spell Effect 01':
      'You touch one object that is no larger than 10 feet in any dimension. Until the spell ends, the object sheds bright light in a 20-foot radius and dim light for an additional 20 feet. The light can be colored as you like. Completely covering the object with something opaque blocks the light. The spell ends if you cast it again or dismiss it as an action.\nIf you target an object held or worn by a hostile creature, that creature must succeed on a Dexterity saving throw to avoid the spell.',
    'SpellSheet1_Spell Name 02': 'Resistance',
    'SpellSheet 1_Spells Level 02': '0',
    'SpellSheet1_Spell School 02': 'abjuration',
    'SpellSheet1_Range 02': 'touch',
    'SpellSheet1_Casting Time 02': '1 action',
    'SpellSheet1_Ritual 02': 'Off',
    'SpellSheet1_Save 02': '-',
    'SpellSheet1_Duration 02': '1 min',
    'SpellSheet1_Concentration 02': 'Yes',
    'SpellSheet1_Component 02': 'miniature cloak',
    'SpellSheet1_Verbal 02': 'Yes',
    'SpellSheet1_Somatic 02': 'Yes',
    'SpellSheet1_Material 02': 'Yes',
    'SpellSheet1_Prepared 02': 'Yes',
    'SpellSheet1_Spell Effect 02':
      'You touch one willing creature. Once before the spell ends, the target can roll a d4 and add the number rolled to one saving throw of its choice. It can roll the die before or after making the saving throw. The spell then ends.',
    'SpellSheet1_Spell Name 03': 'Sacred Flame',
    'SpellSheet 1_Spells Level 03': '0',
    'SpellSheet1_Spell School 03': 'evocation',
    'SpellSheet1_Range 03': "60'",
    'SpellSheet1_Casting Time 03': '1 action',
    'SpellSheet1_Ritual 03': 'Off',
    'SpellSheet1_Save 03': 'Dex',
    'SpellSheet1_Duration 03': 'instant',
    'SpellSheet1_Concentration 03': 'Off',
    'SpellSheet1_Components 03': '',
    'SpellSheet1_Verbal 03': 'Yes',
    'SpellSheet1_Somatic 03': 'Yes',
    'SpellSheet1_Material 03': 'Off',
    'SpellSheet1_Prepared 03': 'Yes',
    'SpellSheet1_Spell Effect 03':
      'Flame-like radiance descends on a creature that you can see within range. The target must succeed on a Dexterity saving throw or take 1d8 radiant damage. The target gains no benefit from cover for this saving throw.\nThe spells damage increases by 1d8 when you reach 5th level (2d8), 11th level (3d8), and 17th level (4d8).',
    'SpellSheet1_Spell Name 04': 'Spare the Dying',
    'SpellSheet 1_Spells Level 04': '0',
    'SpellSheet1_Spell School 04': 'necromancy',
    'SpellSheet1_Range 04': 'touch',
    'SpellSheet1_Casting Time 04': '1 action',
    'SpellSheet1_Ritual 04': 'Off',
    'SpellSheet1_Save 04': '-',
    'SpellSheet1_Duration 04': 'instant',
    'SpellSheet1_Concentration 04': 'Off',
    'SpellSheet1_Components 04': '',
    'SpellSheet1_Verbal 04': 'Yes',
    'SpellSheet1_Somatic 04': 'Yes',
    'SpellSheet1_Material 04': 'Off',
    'SpellSheet1_Prepared 04': 'Yes',
    'SpellSheet1_Spell Effect 04':
      'You touch a living creature that has 0 hit points. The creature becomes stable. This spell has no effect on undead or constructs.',
    'SpellSheet1_Spell Name 05': 'Burning Hands',
    'SpellSheet 1_Spells Level 05': '1',
    'SpellSheet1_Spell School 05': 'evocation',
    'SpellSheet1_Range 05': "self (15' cone)",
    'SpellSheet1_Casting Time 05': '1 action',
    'SpellSheet1_Ritual 05': 'Off',
    'SpellSheet1_Save 05': 'Dex',
    'SpellSheet1_Duration 05': 'instant',
    'SpellSheet1_Concentration 05': 'Off',
    'SpellSheet1_Components 05': '',
    'SpellSheet1_Verbal 05': 'Yes',
    'SpellSheet1_Somatic 05': 'Yes',
    'SpellSheet1_Material 05': 'Off',
    'SpellSheet1_Prepared 05': 'Yes',
    'SpellSheet1_Spell Effect 05':
      'As you hold your hands with thumbs touching and fingers spread, a thin sheet of flames shoots forth from your outstretched fingertips. Each creature in a 15-foot cone must make a Dexterity saving throw. A creature takes 3d6 fire damage on a failed save, or half as much damage on a successful one.\nThe fire ignites any flammable objects in the area that arent being worn or carried.\nAt Higher Levels. When you cast this spell using a spell slot of 2nd level or higher, the damage increases by 1d6 for each slot level above 1st.',
    'SpellSheet1_Spell Name 06': 'Cure Wounds',
    'SpellSheet 1_Spells Level 06': 1,
    'SpellSheet1_Spell School 06': 'evocation',
    'SpellSheet1_Range 06': 'touch',
    'SpellSheet1_Casting Time 06': '1 action',
    'SpellSheet1_Ritual 06': 'Off',
    'SpellSheet1_Save 06': '-',
    'SpellSheet1_Duration 06': 'instant',
