    'SpellSheet1_Verbal 06': 'Yes',
    'SpellSheet1_Somatic 06': 'Yes',
    'SpellSheet1_Material 06': 'Off',
    'SpellSheet1_Prepared 06': 'Off',
    'SpellSheet1_Spell Effect 06':
      'A creature you touch regains a number of hit points equal to 1d8 + your spellcasting ability modifier. This spell has no effect on undead or constructs.\nAt Higher Levels. When you cast this spell using a spell slot of 2nd level or higher, the healing increases by 1d8 for each slot level above 1st.',
    'SpellSheet1_Spell Name 07': 'Faerie Fire',
    'SpellSheet 1_Spells Level 07': 1,
    'SpellSheet1_Spell School 07': 'evocation',
    'SpellSheet1_Range 07': "60'",
    'SpellSheet1_Casting Time 07': '1 action',
    'SpellSheet1_Ritual 07': 'Off',
