    'SpellSheet1_Somatic 07': 'Off',
    'SpellSheet1_Material 07': 'Off',
    'SpellSheet1_Prepared 07': 'Yes',
    'SpellSheet1_Spell Effect 07':
      'Each object in a 20-foot cube within range is outlined in blue, green, or violet light (your choice). Any creature in the area when the spell is cast is also outlined in light if it fails a Dexterity saving throw. For the duration, objects and affected creatures shed dim light in a 10-foot radius.\nAny attack roll against an affected creature or object has advantage if the attacker can see it, and the affected creature or object cant benefit from being invisible.',
    'SpellSheet1_Spell Name 08': 'Guiding Bolt',
    'SpellSheet 1_Spells Level 08': 1,
    'SpellSheet1_Spell School 08': 'evocation',
