    Backstory:
      "Having no family or options, Bellana signed on with a merchant ship as an adolescent. She served on various ships for nearly 20 years, gradually growing disenchanted. She wasn't happy because she didn't actually enjoy sailing. Some of the moments were good, but she generally didn't enjoy being with other people -- they were too loud, they were rude, they shot at birds for sport and killed sea life for no reason. \n\nShe did love the sea, however. When she finally had enough, she decided she was going to live in a way that made her happy, not just enough gold to eat. She left the ship and the city where it was docked, and moved along the coast till she was isolated. \n\nShe met a community of sea elves and found that in small doses, she did enjoy the company of others. She worked with them from time to time, lending what help she could, earning their friendship. Eventually she fell in love with a scion of a family important in the community, they started to make plans for their future, but the family heads objected. They liked Bellana, but they didn't think of her as one of their own. Bellana still sees her love, but for now they have stopped planning for a future different than the present they live in.",
