    'SpellSheet1_Duration 01': '1 min',
    'SpellSheet1_Concentration 01': 'Off',
    'SpellSheet1_Components 01': 'a bit of fleece',
    'SpellSheet1_Verbal 01': 'Off',
    'SpellSheet1_Somatic 01': 'Yes',
    'SpellSheet1_Material 01': 'Yes',
    'SpellSheet1_Prepared 01': 'Yes',
    'SpellSheet1_Spell Effect 01':
      'You create a sound or an image of an object within range that lasts for the duration. The illusion also ends if you dismiss it as an action or cast this spell again.\nIf you create a sound, its volume can range from a whisper to a scream. It can be your voice, someone elses voice, a lions roar, a beating of drums, or any other sound you choose. The sound continues unabated throughout the duration, or you can make discrete sounds at different times before the spell ends.\nIf you create an image of an objectsuch as a chair, muddy footprints, or a small chestit must be no larger than a 5-foot cube. The image cant create sound, light, smell, or any other sensory effect. Physical interaction with the image reveals it to be an illusion, because things can pass through it.\nIf a creature uses its action to examine the sound or image, the creature can determine that it is an illusion with a successful Intelligence (Investigation) check against your spell save DC. If a creature discerns the illusion for what it is, the illusion becomes faint to the creature.',
    'SpellSheet1_Spell Name 02': 'Mending',
    'SpellSheet 1_Spells Level 02': 'C',
    'SpellSheet1_Spell School 02': 'transmutation',
    'SpellSheet1_Range 02': 'touch',
    'SpellSheet1_Casting Time 02': '1 min',
    'SpellSheet1_Ritual 02': 'Off',
    'SpellSheet1_Save 02': '',
    'SpellSheet1_Duration 02': 'instant',
    'SpellSheet1_Concentration 02': 'Off',
    'SpellSheet1_Component 02': '2 lodestones',
    'SpellSheet1_Verbal 02': 'Yes',
    'SpellSheet1_Somatic 02': 'Yes',
    'SpellSheet1_Material 02': 'Yes',
    'SpellSheet1_Prepared 02': 'Yes',
    'SpellSheet1_Spell Effect 02':
      'This spell repairs a single break or tear in an object you touch, such as a broken chain link, two halves of a broken key, a torn cloak, or a leaking wineskin. As long as the break or tear is no larger than 1 foot in any dimension, you mend it. leaving no trace of the former damage.\nThis spell can physically repair a magic item or construct, but the spell cant restore magic to such an object.',
    'SpellSheet1_Spell Name 03': 'Thorn Whip',
    'SpellSheet 1_Spells Level 03': 'C',
    'SpellSheet1_Spell School 03': 'transmutation',
    'SpellSheet1_Range 03': "30'",
    'SpellSheet1_Casting Time 03': '1 action',
    'SpellSheet1_Ritual 03': 'Off',
    'SpellSheet1_Save 03': '',
    'SpellSheet1_Duration 03': 'instant',
    'SpellSheet1_Concentration 03': 'Off',
    'SpellSheet1_Components 03': 'stem of thorny plant',
    'SpellSheet1_Verbal 03': 'Yes',
    'SpellSheet1_Somatic 03': 'Yes',
    'SpellSheet1_Material 03': 'Yes',
    'SpellSheet1_Prepared 03': 'Yes',
    'SpellSheet1_Spell Effect 03':
      'You create a long, vine-like whip covered in thorns that lashes out at your command toward a creature in range. Make a melee spell attack against the target. If the attack hits, the creature takes 1d6 piercing damage, and if the creature is Large or smaller, you pull the creature up to 10 feet closer to you.\nThis spells damage increases by 1d6 when you reach\n5th level (2d6), 11th level (3d6), and 17th level (4d6).',
    'SpellSheet1_Spell Name 04': 'Cure Wounds',
    'SpellSheet 1_Spells Level 04': '1',
    'SpellSheet1_Spell School 04': 'evocation',
    'SpellSheet1_Range 04': 'touch',
    'SpellSheet1_Casting Time 04': '1 action',
    'SpellSheet1_Ritual 04': 'Off',
    'SpellSheet1_Save 04': '',
    'SpellSheet1_Duration 04': 'instant',
    'SpellSheet1_Concentration 04': 'Off',
    'SpellSheet1_Components 04': '',
    'SpellSheet1_Verbal 04': 'Yes',
    'SpellSheet1_Somatic 04': 'Yes',
    'SpellSheet1_Material 04': 'Off',
    'SpellSheet1_Prepared 04': 'Yes',
    'SpellSheet1_Spell Effect 04':
      'A creature you touch regains a number of hit points equal to 1d8 + your spellcasting ability modifier. This spell has no effect on undead or constructs.\nAt Higher Levels. When you cast this spell using a spell slot of 2nd level or higher, the healing increases by 1d8 for each slot level above 1st.',
    'SpellSheet1_Spell Name 05': 'Entangle',
    'SpellSheet 1_Spells Level 05': '1',
    'SpellSheet1_Spell School 05': 'conjuration',
    'SpellSheet1_Range 05': "90'",
    'SpellSheet1_Casting Time 05': '1 action',
    'SpellSheet1_Ritual 05': 'Off',
    'SpellSheet1_Save 05': 'Str',
    'SpellSheet1_Duration 05': '1 min',
    'SpellSheet1_Concentration 05': 'Yes',
    'SpellSheet1_Components 05': '',
    'SpellSheet1_Verbal 05': 'Yes',
    'SpellSheet1_Somatic 05': 'Yes',
    'SpellSheet1_Material 05': 'Off',
    'SpellSheet1_Prepared 05': 'Yes',
    'SpellSheet1_Spell Effect 05':
      'Grasping w eeds and vines sprout from the ground in a 20-foot square starting from a point within range. For the duration, these plants turn the ground in the area into difficult terrain.\nA creature in the area when you cast the spell must succeed on a Strength saving throw or be restrained by the entangling plants until the spell ends. A creature restrained by the plants can use its action to make a Strength check against your spell save DC. On a success, it frees itself.\nWhen the spell ends, the conjured plants wilt away.',
    'SpellSheet1_Spell Name 06': 'Fog Cloud',
    'SpellSheet 1_Spells Level 06': 1,
    'SpellSheet1_Spell School 06': 'conjuration',
    'SpellSheet1_Range 06': "120'",
    'SpellSheet1_Casting Time 06': '1 action',
    'SpellSheet1_Ritual 06': 'Off',
    'SpellSheet1_Save 06': '',
    'SpellSheet1_Duration 06': '1 hour',
    'SpellSheet1_Concentration 06': 'Yes',
    'SpellSheet1_Components 06': '',
    'SpellSheet1_Verbal 06': 'Yes',
    'SpellSheet1_Somatic 06': 'Yes',
    'SpellSheet1_Material 06': 'Off',
    'SpellSheet1_Prepared 06': 'Yes',
    'SpellSheet1_Spell Effect 06':
      'You create a 20-foot-radius sphere of fog centered on a point within range. The sphere spreads around corners, and its area is heavily obscured. It lasts for the duration or until a wind of moderate or greater speed (at least 10 miles per hour) disperses it.\nAt Higher Levels. When you cast this spell using a spell slot of 2nd level or higher, the radius o f the fog increases by 20 feet for each slot level above 1st.',
    'SpellSheet1_Spell Name 07': 'Healing Word',
    'SpellSheet 1_Spells Level 07': 1,
    'SpellSheet1_Spell School 07': 'evocation',
    'SpellSheet1_Range 07': "60'",
    'SpellSheet1_Casting Time 07': '1 bonus',
    'SpellSheet1_Ritual 07': 'Off',
    'SpellSheet1_Save 07': '',
    'SpellSheet1_Duration 07': 'instant',
    'SpellSheet1_Concentration 07': 'Off',
    'SpellSheet1_Components 07': '',
    'SpellSheet1_Verbal 07': 'Yes',
    'SpellSheet1_Somatic 07': 'Off',
    'SpellSheet1_Material 07': 'Off',
    'SpellSheet1_Prepared 07': 'Yes',
    'SpellSheet1_Spell Effect 07':
      'A creature of your choice that you can see within range regains hit points equal to 1d4 + your spellcasting ability modifier. This spell has no effect on undead or constructs.\nAt Higher Levels. When you cast this spell using a spell slot of 2nd level or higher, the healing increases by 1d4 for each slot level above 1st.',
    'SpellSheet1_Spell Name 08': 'Speak with Animals',
    'SpellSheet 1_Spells Level 08': 1,
    'SpellSheet1_Spell School 08': 'divination',
    'SpellSheet1_Range 08': 'self',
    'SpellSheet1_Casting Time 08': '1 action',
    'SpellSheet1_Ritual 08': 'Off',
    'SpellSheet1_Save 08': '',
    'SpellSheet1_Duration 08': '10 min',
    'SpellSheet1_Concentration 08': 'Off',
    'SpellSheet1_Components 08': '',
    'SpellSheet1_Verbal 08': 'Yes',
    'SpellSheet1_Somatic 08': 'Yes',
    'SpellSheet1_Material 08': 'Off',
    'SpellSheet1_Prepared 08': 'Yes',
    'SpellSheet1_Spell Effect 08':
      'You gain the ability to comprehend and verbally communicate with beasts for the duration. The knowledge and awareness of many beasts is limited by their intelligence, but at minimum, beasts can give you information about nearby locations and monsters, including whatever they can perceive or have perceived within the past day. You might be able to persuade a beast to perform a small favor for you, at the DMs discretion.',
