    'Personality Traits':
      "I am always calm, no matter what. I never raise my voice or let my emotions control me.I don't pay attention to the risks in a situation -- never tell me the odds.I am slow to trust, slower to let friends go.",
    'Features & Traits':
      "RACIALDarkvision 60'Menacing (intimidation proficiency)Relentless Endurance (drop to 1 instead of 0 hp if not killed)Savage Attacks (1 extra damage die on critical hit)CLASSExpertise (perception, intimidation)Sneak Attack (1d6)BACKGROUNDCriminal Specialty: EnforcerFeature: Criminal Contact",
    'Character Appearance': '',
