    'Allies & Organizations 2': '',
    'Character Backstory':
      "There's not a lot of work for half-orcs in some societies. But one job that is always available is being the muscle in some gang. That's where Borg ended up. He did his share of looking menacing for racketeering, guarding bodies (some of them live, some of them not so much), and smash and grab. He didn't have strong feelings about it, it was just a job.One fateful day he was brought along on a job. Borg didn't even know what it was for. Fewer questions usually meant less potential trouble. The assumption was another extortion racket or establishing some dominance. But everything went to hell.The job was a very literal battle in the ongoing gang war. Dozens of mooks from both sides doing their best to gut the others. There were even magic users flinging spells carelessly. People died. A lot of people died. People who had nothing to do with it died in fires or collapsed buildings. And it seemed like no one cared.Borg hadn't faced the morality of his work before, but he didn't like how this made him feel. He quit the gang work.Borg still doesn't have very strong feelings about law and order, but feels that the Order of the Gauntlet gives him the opportunities to make up a little for what he did. And he still likes tearing it up. Show him a group of people who have been hurting others, and like as not, he'll jump in bashing things with his mace.",
