    'SpellSheet1_Spell School 01': 'evocation',
    'SpellSheet1_Range 01': "120'",
    'SpellSheet1_Casting Time 01': '1 action',
    'SpellSheet1_Ritual 01': 'Off',
    'SpellSheet1_Save 01': '',
    'SpellSheet1_Duration 01': 'instant',
    'SpellSheet1_Concentration 01': 'Off',
    'SpellSheet1_Components 01': '',
    'SpellSheet1_Verbal 01': 'Yes',
    'SpellSheet1_Somatic 01': 'Yes',
    'SpellSheet1_Material 01': 'Off',
    'SpellSheet1_Prepared 01': 'Yes',
    'SpellSheet1_Spell Effect 01':
      'A beam o f crackling energy streaks toward a creature within range. Make a ranged spell attack against the target. On a hit, the target takes 1dlO force damage.\nThe spell creates more than one beam when you reach higher levels: two beams at 5th level, three beams at 11th level, and four beams at 17th level. You can direct the beams at the same target or at different ones. Make a separate attack roll for each beam.',
    'SpellSheet1_Spell Name 02': 'Poison Spray',
    'SpellSheet 1_Spells Level 02': 'C',
    'SpellSheet1_Spell School 02': 'conjuration',
    'SpellSheet1_Range 02': "10'",
    'SpellSheet1_Casting Time 02': '1 action',
    'SpellSheet1_Ritual 02': 'Off',
    'SpellSheet1_Save 02': 'Con',
    'SpellSheet1_Duration 02': 'instant',
    'SpellSheet1_Concentration 02': 'Off',
    'SpellSheet1_Component 02': '',
    'SpellSheet1_Verbal 02': 'Yes',
    'SpellSheet1_Somatic 02': 'Yes',
    'SpellSheet1_Material 02': 'Off',
    'SpellSheet1_Prepared 02': 'Yes',
    'SpellSheet1_Spell Effect 02':
      'You extend your hand toward a creature you can see within range and project a puff of noxious gas from your palm. The creature must succeed on a Constitution saving throw or take 1d12 poison damage.\nThis spells damage increases by 1d12 when you reach 5th level (2d12), 11th level (3d12), and 17th level (4d12).',
    'SpellSheet1_Spell Name 03': 'Hellish Rebuke',
    'SpellSheet 1_Spells Level 03': '1',
    'SpellSheet1_Spell School 03': 'evocation',
    'SpellSheet1_Range 03': "60'",
    'SpellSheet1_Casting Time 03': '1 reaction',
    'SpellSheet1_Ritual 03': 'Off',
    'SpellSheet1_Save 03': 'Dex',
    'SpellSheet1_Duration 03': 'instant',
    'SpellSheet1_Concentration 03': 'Off',
    'SpellSheet1_Components 03': '',
    'SpellSheet1_Verbal 03': 'Yes',
    'SpellSheet1_Somatic 03': 'Yes',
    'SpellSheet1_Material 03': 'Off',
    'SpellSheet1_Prepared 03': 'Yes',
    'SpellSheet1_Spell Effect 03':
      'You point your finger, and the creature that damaged you is momentarily surrounded by hellish flames. The creature must make a Dexterity saving throw. It takes 2d10 fire damage on a failed save, or half as much damage on a successful one.\nAt Higher Levels. When you cast this spell using a spell slot of 2nd level or higher, the damage increases by 1d10 for each slot level above 1st.',
    'SpellSheet1_Spell Name 04': 'Hex',
    'SpellSheet 1_Spells Level 04': '1',
    'SpellSheet1_Spell School 04': 'enchantment',
    'SpellSheet1_Range 04': "90'",
    'SpellSheet1_Casting Time 04': '1 bonus',
    'SpellSheet1_Ritual 04': 'Off',
    'SpellSheet1_Save 04': '',
    'SpellSheet1_Duration 04': '1 hour',
    'SpellSheet1_Concentration 04': 'Yes',
    'SpellSheet1_Components 04': 'petrified eye of newt',
    'SpellSheet1_Verbal 04': 'Yes',
    'SpellSheet1_Somatic 04': 'Yes',
    'SpellSheet1_Material 04': 'Yes',
    'SpellSheet1_Prepared 04': 'Yes',
    'SpellSheet1_Spell Effect 04':
      'You place a curse on a creature that you can see within range. Until the spell ends, you deal an extra 1d6 necrotic damage to the target whenever you hit it with an attack. Also, choose one ability when you cast the spell. The target has disadvantage on ability checks made with the chosen ability.\nIf the target drops to 0 hit points before this spell ends, you can use a bonus action on a subsequent turn of yours to curse a new creature.\nA remove curse cast on the target ends this spell early.\nAt Higher Levels. When you cast this spell using a spell slot of 3rd or 4th level, you can maintain your concentration on the spell for up to 8 hours. When you use a spell slot of 5th level or higher, you can maintain your concentration on the spell for up to 24 hours.',
