      "* Darkvision 60'\n* Menacing (intimidation proficiency)\n* Relentless Endurance (drop to 1 instead of 0 hp if not killed)\n* Savage Attacks (1 extra damage die on critical hit)\n* Spellcasting\n* Ritual Casting\n* Arcane Recovery\n** regain 1 level of spell slot after short rest\n* Business/Guild: Glassblowers & Glaziers\n",
