    'SpellSheet1_Spell Name 01': 'Friends',
    'SpellSheet 1_Spells Level 01': '0',
    'SpellSheet1_Spell School 01': 'enchantment',
    'SpellSheet1_Range 01': 'Self',
    'SpellSheet1_Casting Time 01': '1 action',
    'SpellSheet1_Ritual 01': 'Off',
    'SpellSheet1_Save 01': '-',
    'SpellSheet1_Duration 01': '1 min',
    'SpellSheet1_Concentration 01': 'Yes',
    'SpellSheet1_Components 01': 'makeup',
    'SpellSheet1_Verbal 01': 'Off',
    'SpellSheet1_Somatic 01': 'Yes',
    'SpellSheet1_Material 01': 'Yes',
    'SpellSheet1_Prepared 01': 'Yes',
    'SpellSheet1_Spell Effect 01':
      'For the duration, you have advantage on all Charisma checks directed at one creature of your choice that isnt hostile toward you. When the spell ends, the creature realizes that you used magic to influence its mood and becomes hostile toward you. A creature prone to violence might attack you. Another creature might seek retribution in other ways (at the DMs discretion), depending on the nature o f your interaction with it.',
    'SpellSheet1_Spell Name 02': 'Viscious Mockery',
    'SpellSheet 1_Spells Level 02': '0',
    'SpellSheet1_Spell School 02': 'Enchantment',
    'SpellSheet1_Range 02': "60'",
    'SpellSheet1_Casting Time 02': '1 action',
    'SpellSheet1_Ritual 02': 'Off',
    'SpellSheet1_Save 02': 'Wis',
    'SpellSheet1_Duration 02': 'instant',
    'SpellSheet1_Concentration 02': 'Off',
    'SpellSheet1_Component 02': '',
    'SpellSheet1_Verbal 02': 'Yes',
    'SpellSheet1_Somatic 02': 'Off',
    'SpellSheet1_Material 02': 'Off',
    'SpellSheet1_Prepared 02': 'Yes',
    'SpellSheet1_Spell Effect 02':
      'You unleash a string o f insults laced with subtle enchantments at a creature you can see within range. If the target can hear you (though it need not understand you), it must succeed on a W isdom saving throw or take 1d4 psychic damage and have disadvantage on the next attack roll it makes before the end o f its next turn.\nThis spells damage increases by 1d4 when you reach 5th level (2d4), 11th level (3d4), and 17th level (4d4).',
    'SpellSheet1_Spell Name 03': 'Charm Person',
    'SpellSheet 1_Spells Level 03': '1',
    'SpellSheet1_Spell School 03': 'ENCHANTMENT',
    'SpellSheet1_Range 03': "30'",
    'SpellSheet1_Casting Time 03': '1 ACTION',
    'SpellSheet1_Ritual 03': 'Off',
    'SpellSheet1_Save 03': 'Wis',
    'SpellSheet1_Duration 03': '1 hour',
    'SpellSheet1_Concentration 03': 'Off',
    'SpellSheet1_Components 03': '',
    'SpellSheet1_Verbal 03': 'Yes',
    'SpellSheet1_Somatic 03': 'Yes',
    'SpellSheet1_Material 03': 'Off',
    'SpellSheet1_Prepared 03': 'Yes',
    'SpellSheet1_Spell Effect 03':
      'You attempt to charm a humanoid you can see within range. It must make a Wisdom saving throw, and does so with advantage if you or your companions are fighting it. If it fails the saving throw, it is charmed by you until the spell ends or until you or your companions do anything harmful to it. The charmed creature regards you as a friendly acquaintance. When the spell ends, the creature knows it was charmed by you.\nAt Higher Levels. When you cast this spell using a spell slot of 2nd level or higher, you can target one additional creature for each slot level above 1st. The creatures must be within 30 feet of each other when you target them.',
    'SpellSheet1_Spell Name 04': 'Feather Fall',
    'SpellSheet 1_Spells Level 04': '1',
    'SpellSheet1_Spell School 04': 'transmutation',
    'SpellSheet1_Range 04': "60'",
    'SpellSheet1_Casting Time 04': '1 reaction',
    'SpellSheet1_Ritual 04': 'Off',
    'SpellSheet1_Save 04': '-',
    'SpellSheet1_Duration 04': '1 min',
    'SpellSheet1_Concentration 04': 'Off',
    'SpellSheet1_Components 04': 'small feather',
    'SpellSheet1_Verbal 04': 'Yes',
    'SpellSheet1_Somatic 04': 'Off',
    'SpellSheet1_Material 04': 'Yes',
    'SpellSheet1_Prepared 04': 'Yes',
    'SpellSheet1_Spell Effect 04':
      "Choose up to five falling creatures within range. A falling creature's rate o f descent slows to 60 feet per round until the spell ends. If the creature lands before the spell ends, it takes no falling damage and can land on its feet, and the spell ends for that creature",
    'SpellSheet1_Spell Name 05': 'Sleep',
    'SpellSheet 1_Spells Level 05': '1',
    'SpellSheet1_Spell School 05': 'enchantment',
    'SpellSheet1_Range 05': "90'",
    'SpellSheet1_Casting Time 05': '1 action',
    'SpellSheet1_Ritual 05': 'Off',
    'SpellSheet1_Save 05': '-',
    'SpellSheet1_Duration 05': '1 min',
    'SpellSheet1_Concentration 05': 'Off',
    'SpellSheet1_Components 05': 'pinch of sand',
    'SpellSheet1_Verbal 05': 'Yes',
    'SpellSheet1_Somatic 05': 'Yes',
    'SpellSheet1_Material 05': 'Yes',
    'SpellSheet1_Prepared 05': 'Yes',
    'SpellSheet1_Spell Effect 05':
      'This spell sends creatures into a magical slumber. Roll 5d8; the total is how many hit points of creatures this spell can affect. Creatures within 20 feet of a point you choose within range are affected in ascending order of their current hit points (ignoring unconscious creatures).\nStarting with the creature that has the lowest current hit points, each creature affected by this spell falls unconscious until the spell ends, the sleeper takes damage, or someone uses an action to shake or slap the sleeper awake. Subtract each creatures hit points from the total before moving on to the creature with the next lowest hit points. A creatures hit points must be equal to or less than the remaining total for that creature to be affected.\nUndead and creatures immune to being charmed arent affected by this spell.\nAt Higher Levels. When you cast this spell using a spell slot o f 2nd level or higher, roll an additional 2d8 for each slot level above 1st.',
    'SpellSheet1_Spell Name 06': "Tasha's Hideous Laughter",
    'SpellSheet 1_Spells Level 06': 1,
    'SpellSheet1_Spell School 06': 'enchantment',
    'SpellSheet1_Range 06': "30'",
    'SpellSheet1_Casting Time 06': '1 action',
    'SpellSheet1_Ritual 06': 'Off',
    'SpellSheet1_Save 06': 'Wis',
    'SpellSheet1_Duration 06': '1 min',
    'SpellSheet1_Concentration 06': 'Yes',
    'SpellSheet1_Components 06': 'tiny tarts and a feather',
    'SpellSheet1_Verbal 06': 'Yes',
    'SpellSheet1_Somatic 06': 'Yes',
    'SpellSheet1_Material 06': 'Yes',
    'SpellSheet1_Prepared 06': 'Yes',
    'SpellSheet1_Spell Effect 06':
      'A creature of your choice that you can see within range perceives everything as hilariously funny and falls into fits of laughter if this spell affects it. The target must succeed on a Wisdom saving throw or fall prone, becoming incapacitated and unable to stand up for the duration. A creature with an Intelligence score of 4 or\nless isnt affected. \nAt the end of each of its turns, and each time it takes damage, the target can make another Wisdom saving throw. The target has advantage on the saving throw if its triggered by damage. On a success, the spell ends.',
