    'SpellSheet1_Spellcasting Focus': 'A wreath of dried gourd vines',
    'SpellSheet1_Spell Name 01': 'Produce Flame',
    'SpellSheet 1_Spells Level 01': '0',
    'SpellSheet1_Spell School 01': 'Conjuration',
    'SpellSheet1_Range 01': 'self',
    'SpellSheet1_Casting Time 01': '1 action',
    'SpellSheet1_Ritual 01': 'Off',
    'SpellSheet1_Save 01': '-',
    'SpellSheet1_Duration 01': '10 min',
    'SpellSheet1_Concentration 01': 'Off',
    'SpellSheet1_Components 01': '',
    'SpellSheet1_Verbal 01': 'Yes',
    'SpellSheet1_Somatic 01': 'Yes',
    'SpellSheet1_Material 01': 'Off',
    'SpellSheet1_Prepared 01': 'Yes',
    'SpellSheet1_Spell Effect 01':
      'A flickering flame appears in your hand. The flame remains there for the duration and harms neither you nor your equipment. The flame sheds bright light in a 10-foot radius and dim light for an additional 10 feet. The spell ends if you dismiss it as an action or if you cast it again.\nYou can also attack with the flame, although doing so ends the spell. When you cast this spell, or as an action on a later turn, you can hurl the flame at a creature within 30 feet o f you. Make a ranged spell attack. On a hit, the target takes 1d8 fire damage.\nThis spells damage increases by 1d8 when you reach 5th level (2d8), 11th level (3d8), and 17th level (4d8).',
    'SpellSheet1_Spell Name 02': 'Thorn Whip',
    'SpellSheet 1_Spells Level 02': '0',
    'SpellSheet1_Spell School 02': 'Transmutation',
    'SpellSheet1_Range 02': "30'",
    'SpellSheet1_Casting Time 02': '1 action',
    'SpellSheet1_Ritual 02': 'Off',
    'SpellSheet1_Save 02': '',
    'SpellSheet1_Duration 02': 'instant',
    'SpellSheet1_Concentration 02': 'Off',
    'SpellSheet1_Component 02': 'stem of thorned plant',
    'SpellSheet1_Verbal 02': 'Yes',
    'SpellSheet1_Somatic 02': 'Yes',
    'SpellSheet1_Material 02': 'Yes',
    'SpellSheet1_Prepared 02': 'Yes',
    'SpellSheet1_Spell Effect 02':
      'You create a long, vine-like whip covered in thorns that lashes out at your command toward a creature in range.\nMake a melee spell attack against the target. If the attack hits, the creature takes 1d6 piercing damage, and if the creature is Large or smaller, you pull the creature up to 10 feet closer to you.\nThis spells damage increases by 1d6 when you reach\n5th level (2d6), 11th level (3d6), and 17th level (4d6).',
    'SpellSheet1_Spell Name 03': 'Cure Wounds',
    'SpellSheet 1_Spells Level 03': '1',
    'SpellSheet1_Spell School 03': 'Evocation',
    'SpellSheet1_Range 03': 'touch',
    'SpellSheet1_Casting Time 03': '1 action',
    'SpellSheet1_Ritual 03': 'Off',
    'SpellSheet1_Save 03': '-',
    'SpellSheet1_Duration 03': 'instant',
    'SpellSheet1_Concentration 03': 'Off',
    'SpellSheet1_Components 03': '',
    'SpellSheet1_Verbal 03': 'Off',
    'SpellSheet1_Somatic 03': 'Yes',
    'SpellSheet1_Material 03': 'Off',
    'SpellSheet1_Prepared 03': 'Yes',
    'SpellSheet1_Spell Effect 03':
      'A creature you touch regains a number o f hit points equal to 1d8 + your spellcasting ability modifier. This spell has no effect on undead or constructs.\nAt Higher Levels. When you cast this spell using a spell slot of 2nd level or higher, the healing increases by 1d8 for each slot level above 1st',
    'SpellSheet1_Spell Name 04': 'Entangle',
    'SpellSheet 1_Spells Level 04': '1',
    'SpellSheet1_Spell School 04': 'Conjuration',
    'SpellSheet1_Range 04': "90'",
    'SpellSheet1_Casting Time 04': '1 action',
    'SpellSheet1_Ritual 04': 'Off',
    'SpellSheet1_Save 04': 'Str',
    'SpellSheet1_Duration 04': '1 min',
    'SpellSheet1_Concentration 04': 'Yes',
    'SpellSheet1_Components 04': '',
    'SpellSheet1_Verbal 04': 'Yes',
    'SpellSheet1_Somatic 04': 'Yes',
    'SpellSheet1_Material 04': 'Off',
    'SpellSheet1_Prepared 04': 'Yes',
    'SpellSheet1_Spell Effect 04':
      'Grasping w eeds and vines sprout from the ground in a 20-foot square starting from a point within range. For the duration, these plants turn the ground in the area into difficult terrain.\nA creature in the area when you cast the spell must\nsucceed on a Strength saving throw or be restrained\nby the entangling plants until the spell ends. A creature\nrestrained by the plants can use its action to make\na Strength check against your spell save DC. On a\nsuccess, it frees itself.\nWhen the spell ends, the conjured plants wilt away.',
    'SpellSheet1_Spell Name 05': 'Healing Word',
    'SpellSheet 1_Spells Level 05': '1',
    'SpellSheet1_Spell School 05': 'Evocation',
    'SpellSheet1_Range 05': "60'",
    'SpellSheet1_Casting Time 05': '1 bonus action',
    'SpellSheet1_Ritual 05': 'Off',
    'SpellSheet1_Save 05': '-',
    'SpellSheet1_Duration 05': 'instant',
    'SpellSheet1_Concentration 05': 'Off',
    'SpellSheet1_Components 05': '',
    'SpellSheet1_Verbal 05': 'Yes',
    'SpellSheet1_Somatic 05': 'Off',
    'SpellSheet1_Material 05': 'Off',
    'SpellSheet1_Prepared 05': 'Yes',
    'SpellSheet1_Spell Effect 05':
      'A creature o f your choice that you can see within range regains hit points equal to 1d4 + your spellcasting ability modifier. This spell has no effect on undead or constructs.\nAt Higher Levels. When you cast this spell using a\nspell slot of 2nd level or higher, the healing increases by 1d4 for each slot level above 1st.',
    'SpellSheet1_Spell Name 06': 'Speak with Animals',
    'SpellSheet 1_Spells Level 06': 1,
    'SpellSheet1_Spell School 06': 'Divination',
    'SpellSheet1_Range 06': 'self',
    'SpellSheet1_Casting Time 06': '1 action',
    'SpellSheet1_Ritual 06': 'Off',
    'SpellSheet1_Save 06': '-',
    'SpellSheet1_Duration 06': '10 min',
    'SpellSheet1_Concentration 06': 'Off',
    'SpellSheet1_Components 06': '',
    'SpellSheet1_Verbal 06': 'Yes',
    'SpellSheet1_Somatic 06': 'Yes',
    'SpellSheet1_Material 06': 'Off',
    'SpellSheet1_Prepared 06': 'Yes',
    'SpellSheet1_Spell Effect 06':
      'You gain the ability to comprehend and verbally communicate with beasts for the duration. The knowledge and awareness of many beasts is limited by their intelligence, but at minimum, beasts can give you information about nearby locations and monsters, including whatever they can perceive or have perceived within the past day. You might be able to persuade a beast to perform a small favor for you, at the DMs discretion.',
    'SpellSheet1_Spell Name 07': 'Thunderwave',
    'SpellSheet 1_Spells Level 07': 1,
    'SpellSheet1_Spell School 07': 'Evocation',
    'SpellSheet1_Range 07': "self (15' cube)",
    'SpellSheet1_Casting Time 07': '1 action',
    'SpellSheet1_Ritual 07': 'Off',
    'SpellSheet1_Save 07': 'Con',
    'SpellSheet1_Duration 07': 'instant',
    'SpellSheet1_Concentration 07': 'Off',
    'SpellSheet1_Components 07': '',
    'SpellSheet1_Verbal 07': 'Yes',
    'SpellSheet1_Somatic 07': 'Yes',
    'SpellSheet1_Material 07': 'Off',
    'SpellSheet1_Prepared 07': 'Yes',
    'SpellSheet1_Spell Effect 07':
      'A wave o f thunderous force sweeps out from you. Each creature in a 15-foot cube originating from you must make a Constitution saving throw. On a failed save, a creature takes 2d8 thunder damage and is pushed 10 feet away from you. On a successful save, the creature takes half as much damage and isnt pushed.\nIn addition, unsecured objects that are completely within the area o f effect are automatically pushed 10 feet away from you by the spells effect, and the spell emits a thunderous boom audible out to 300 feet.\nAt Higher Levels. When you cast this spell using a spell slot of 2nd level or higher, the damage increases by 1d8 for each slot level above 1st.',
