    FactionName: '',
    Backstory:
      "Tova trained as a woodcarver, and she excelled at the craft, creating beautiful decorations, working with a carpenter to build the village's furniture and forming works of art. She assumed this would be her quiet, happy life.\n\nWhen she was 19, a deva appeared in her village and slew several people. It offered no explanation.\n\nThe village seemed helpless to stop it, but Tova carefully stalked it with her bow, and got a lucky shot in the deva's eye. She followed with a whirling attack with her sword and axe, killing the deva.\n\nTova is no longer satisfied staying a carver. She has a desperate need to protect her people and the world from the celestial threat.",
    'Feat+Traits':
      "Tova's hair is very curly/frizzy. She wears it in long braids.\n\nBecause of her encounter with the deva, Tova does not believe all or even most celestials are good. She hates them with a vengeance. \n\nThis incident fed her tendencies to disbelieve reputation, to only give respect based on actions she has witnessed, to always be honest and genuine, and to always defend the weak from the strong -- especially from those enemies who come in the guise of friends.",
