    Backstory:
      'Lois had a knack for proving what happened in school between students. Teachers knew they could trust her explanations, and the kids liked her because she got bullies punished. That changed when some kids tried to frame their class bully, and Lois was just as vigorous proving their guilt as the bullies\'.\n\nA loner since that incident, Lois grew increasingly paranoid and increasingly skilled at ferreting out clues and answers.\n\nOffering her investigation skills for hire seemed a natural choice. She tried at first to do a standard wizard-for-hire gig, but she was unhappy except when there was a mystery afoot. Eventually, she opened up an "investigations" shop and hasn\'t looked back.',
