    'SpellSheet1_Spell Effect 07':
      "You gain the service o f a familiar, a spirit that takes an animal form you choose. The familiar has the statistics o f the chosen form, though it is a celestial, fey, or fiend instead of a beast.\nYour familiar acts independently of you but obeys your commands. In rolls its own initiative and acts on its own turn. A familiar cant attack, but can take other actions.\nWhen the familiar drops to 0 hit points, it disappears. It reappears after you cast this spell again.\nWhile within 100 feet of you, you can communicate with it telepathically. As an action, you can see through your familiars eyes and hear what it hears until the start of your next turn, gaining the benefits of any special senses that the familiar has. During this time, you are deaf and blind to your own senses.\nAs an action, you may temporarily or permanently dismiss your familiar.\nCast this spell again to choose a new form for the familiar\nAs a reaction the familiar can deliver touch ranged spells when within 100' of you.",
