    'SpellSheet1_Prepared 08': 'Off',
    'SpellSheet1_Spell Effect 08':
      'You choose one object that you must touch throughout the casting o f the spell. If it is a magic item or some other magic-imbued object, you learn its properties and how to use them, whether it requires attunement to use, and how many charges it has, if any. You learn whether any spells are affecting the item and what they are. If the item w as created by a spell, you learn which spell created it.\nIf you instead touch a creature throughout the casting, you learn what spells, if any, are currently affecting it.',
    'SpellSheet1_Spell Name 09': 'Unseen Servent',
    'SpellSheet 1_Spells Level 09': 1,
    'SpellSheet1_Spell School 09': 'conjuration',
    'SpellSheet1_Range 09': "60'",
    'SpellSheet1_Casting Time 09': '1 action',
    'SpellSheet1_Ritual 09': 'Yes',
    'SpellSheet1_Save 09': '',
    'SpellSheet1_Duration 09': '1 hour',
    'SpellSheet1_Concentration 09': 'Off',
    'SpellSheet1_Components 09': 'string and wood',
    'SpellSheet1_Verbal 09': 'Yes',
    'SpellSheet1_Somatic 09': 'Yes',
    'SpellSheet1_Material 09': 'Yes',
    'SpellSheet1_Prepared 09': 'Off',
    'SpellSheet1_Spell Effect 09':
      'This spell creates an invisible, mindless, shapeless force that performs simple tasks at your command until the spell ends. The servant springs into existence in an unoccupied space on the ground within range. It has AC 10, 1 hit point, and a Strength of 2, and it cant attack. If it drops to 0 hit points, the spell ends.\nOnce on each of your turns as a bonus action, you can mentally command the servant to move up to 15 feet and interact with an object. The servant can perform simple tasks that a human servant could do, such as fetching things, cleaning, mending, folding clothes, lighting fires, serving food, and pouring wine. Once you give the command, the servant performs the task to the best of its ability until it completes the task, then waits for your next command.\nIf you command the servant to perform a task that would move it more than 60 feet away from you, the spell ends.',
