    'SpellSheet1_Material 03': 'Yes',
    'SpellSheet1_Prepared 03': 'Yes',
    'SpellSheet1_Spell Effect 03':
      'Sends creatures into a magical slumber. Roll 5d8; the total is how many hit points o f creatures this spell can affect. Creatures within 20 feet of a point you choose within range are affected in ascending order of their current hit points (ignoring unconscious creatures).\nroll an additional 2d8 for each slot level above 1st.',
