    'Front_Patron 1':
      "FEY PRESENCE: Each creature in a 10' cube centered on me makes a Wis save against my spell save DC or be charmed or frightened until the end of my next turn. 1 Action, long rest to recharge",
    'Front_Pact Boon 3': '',
    'Front_Patron 6':
      'MISTY ESCAPE: Starting at 6th level, you can vanish in a puff of mist in response to harm. When you take damage, you can use your reaction to turn invisible and teleport up to 60 feet to an unoccupied space you can see. You remain invisible until the start of your next turn or until you attack or cast a spell. 1 Action, long rest to recharge',
    'Front_Patron 10':
      'BEGUILING DEFENSE: Beginning at 10th level, your patron teaches you how to turn the mind-affecting magic o f your enemies against them. You are immune to being charmed, and when another creature attempts to charm you, you can use your reaction to attempt to turn the charm back on that creature. The creature must succeed on a Wisdom saving throw against your warlock spell save DC or be charmed by you for 1 minute or until the creature takes any damage',
