    Back_Scars: '',
    'Back_Personality Traits':
      'When I set my mind to something, I follow through no matter what gets in my way.\nI am confident, but bored easily outside a specific range of activities.',
    Back_Ideals:
      'Tyrants (such as closed-minded fathers) should not be allowed to oppress people',
    Back_Bonds:
      'I wish my childhood sweetheart had come with me to pursue my destiny',
    Back_Flaws:
      "I'm convinced of the significance of my destiny, and blind to my shortcomings and the risk of failure",
    Back_Background: '',
    Back_Allies: '',
    Back_Enemies: '',
    'Back_Additional Features & Traits':
      "Marcus was born to privilege, and that's probably why he felt he had a right to his arcane studies. His father didn't approve of the time Marcus spent consorting with elves and fairies, and constantly tried to get him to study more manly (read: \"martial\") pursuits.\nTall and gangly, Marcus wasn't particularly suited to knighthood. To Marcus, his pursuit to understand the fey and all things mystical was the only thing he cared about.\nUntil he fell in love with Masene, an elf  girl who was also becoming a warlock. His father was livid and forbade Marcus to see her. She was an elf, and a commoner elf at that. When Marcus visited her anyway, his father arranged for the elf family to be relocated to a distant city.\nMarcus had had enough. Taking the arcane book written by his grandmother, but which he didn't fully understand, he left home in the middle of the night and never looked back.\n\nMarcus cares about very few things: Masene, his magic, his patron, dragonchess, and all things weird and supernatural. Losing Masene has made him nearly fanatical about self-determination.",
