    'Features and Traits':
      "* Darkvision\n* Hellish Resistance to fire dmg\n* Infernal Legacy (thaumaturgy)\n* Beauty Domain:\n ** Beauty's Refuge - +2 temp hp to 1-12 allies\nPosition of Privilege",
    Age: '20',
