    FactionName: '',
    Backstory:
      'Generations ago the Mor-Kallis family was raised to nobility by the ruling elven king for service to the crown. Over the ensuing decades they gained a reputation for corruption. Some of this reputation was deserved, but a lot of it was anti-tiefling prejudice. The family today is embittered. They are not villainous, but are often mean spirited, especially to each other.\n\nVollena, unwanted by siblings & emotionally abused by her family, grew up hating herself and her tiefling heritage. As she aged she spent more and more time away from the estate. Though she was hardly welcome with the elves, she was never driven out of public space because of her family. However, she was never greeted warmly.\n\nWhen soaking her feet in a stream one morning, trying to escape both family and the public, a traveling Paladin happened upon her. Lady Callenda was the first person Vollena could remember who was kind, who called her beautiful, who showed her she had value. Lady Callenda was also her first kiss.\n\nWhile not strictly a runaway, she left with Lady Callenda and learned the faith of Sune.',
    'Feat+Traits':
      "Vollena's hair is worn in curls to her waist.\n\nHer small but obvious horns grow from her forehead, near her temples, and curl back around the sides of her head.\n\nVollena uses her faith and abilities from following Sune to help others find the beauty in themselves.",
