    'SpellSheet1_Material 01': 'Off',
    'SpellSheet1_Prepared 01': 'Yes',
    'SpellSheet1_Spell Effect 01':
      'A flickering flame appears in your hand. The flame remains there for the duration and harms neither you nor your equipment. The flame sheds bright light in a 10-foot radius and dim light for an additional 10 feet.\nThe spell ends if you dismiss it as an action or if you cast it again.\nYou can also attack with the flame, although doing so ends the spell. When you cast this spell, or as an action on a later turn, you can hurl the flame at a creature within 30 feet of you. Make a ranged spell attack. On a hit, the target takes 1d8 fire damage.\nThis spells damage increases by 1d8 when you reach\n5th level (2d8), 11th level (3d8), and 17th level (4d8).',
    'SpellSheet1_Spell Name 02': 'Thaumaturgy',
    'SpellSheet 1_Spells Level 02': '0',
    'SpellSheet1_Spell School 02': 'transmutation',
    'SpellSheet1_Range 02': "30'",
    'SpellSheet1_Casting Time 02': '1 action',
    'SpellSheet1_Ritual 02': 'Off',
    'SpellSheet1_Save 02': '-',
    'SpellSheet1_Duration 02': '1 min',
    'SpellSheet1_Concentration 02': 'Off',
    'SpellSheet1_Component 02': '',
    'SpellSheet1_Verbal 02': 'Yes',
    'SpellSheet1_Somatic 02': 'Off',
    'SpellSheet1_Material 02': 'Off',
    'SpellSheet1_Prepared 02': 'Yes',
    'SpellSheet1_Spell Effect 02':
      "(tiefling ability)\nManifest a magical effect\n* your voice booms\n* harmless ground tremors\n* instant sound\n* instant open/close unlocked door or window\n* alter your eye appearance\nIf cast multiple times, you can have up to 3 of it's 1-min effects active at a time. You can dismiss an effect as an action",
    'SpellSheet1_Spell Name 03': 'Thorn Whip',
    'SpellSheet 1_Spells Level 03': '0',
    'SpellSheet1_Spell School 03': 'transmutation',
    'SpellSheet1_Range 03': "30'",
    'SpellSheet1_Casting Time 03': '1 action',
    'SpellSheet1_Ritual 03': 'Off',
    'SpellSheet1_Save 03': '-',
    'SpellSheet1_Duration 03': 'instant',
    'SpellSheet1_Concentration 03': 'Off',
    'SpellSheet1_Components 03': 'thorned plant stem',
    'SpellSheet1_Verbal 03': 'Yes',
    'SpellSheet1_Somatic 03': 'Yes',
    'SpellSheet1_Material 03': 'Yes',
    'SpellSheet1_Prepared 03': 'Yes',
    'SpellSheet1_Spell Effect 03':
      'You create a long, vine-like whip covered in thorns that lashes out at your command toward a creature in range. Make a melee spell attack against the target. If the attack hits, the creature takes 1d6 piercing damage, and if the creature is Large or smaller, you pull the creature up to 10 feet closer to you.\nThis spells damage increases by 1d6 when you reach 5th level (2d6), 11th level (3d6), and 17th level (4d6).',
    'SpellSheet1_Spell Name 04': 'Cure Wounds',
    'SpellSheet 1_Spells Level 04': '1',
    'SpellSheet1_Spell School 04': 'evocation',
    'SpellSheet1_Range 04': 'touch',
    'SpellSheet1_Casting Time 04': '1 action',
    'SpellSheet1_Ritual 04': 'Off',
    'SpellSheet1_Save 04': '-',
    'SpellSheet1_Duration 04': 'instant',
    'SpellSheet1_Concentration 04': 'Off',
    'SpellSheet1_Components 04': '',
    'SpellSheet1_Verbal 04': 'Yes',
    'SpellSheet1_Somatic 04': 'Yes',
    'SpellSheet1_Material 04': 'Off',
    'SpellSheet1_Prepared 04': 'Yes',
    'SpellSheet1_Spell Effect 04':
      'A creature you touch regains a number of hit points equal to 1d8 + your spellcasting ability modifier. This spell has no effect on undead or constructs.\nAt Higher Levels. When you cast this spell using a\nspell slot of 2nd level or higher, the healing increases by 1d8 for each slot level above 1st.',
    'SpellSheet1_Spell Name 05': 'Entangle',
    'SpellSheet 1_Spells Level 05': '1',
    'SpellSheet1_Spell School 05': 'conjuration',
    'SpellSheet1_Range 05': "90'",
    'SpellSheet1_Casting Time 05': '1 action',
    'SpellSheet1_Ritual 05': 'Off',
    'SpellSheet1_Save 05': 'str',
    'SpellSheet1_Duration 05': '1 min',
    'SpellSheet1_Concentration 05': 'Yes',
    'SpellSheet1_Components 05': '',
    'SpellSheet1_Verbal 05': 'Yes',
    'SpellSheet1_Somatic 05': 'Yes',
    'SpellSheet1_Material 05': 'Off',
    'SpellSheet1_Prepared 05': 'Yes',
    'SpellSheet1_Spell Effect 05':
      'Grasping weeds and vines sprout from the ground in a 20-foot square starting from a point within range. For the duration, these plants turn the ground in the area into difficult terrain.\nA creature in the area when you cast the spell must succeed on a Strength saving throw or be restrained by the entangling plants until the spell ends. A creature restrained by the plants can use its action to make a Strength check against your spell save DC. On a success, it frees itself.\nWhen the spell ends, the conjured plants wilt away.',
    'SpellSheet1_Spell Name 06': 'Speak with Animals',
    'SpellSheet 1_Spells Level 06': 1,
    'SpellSheet1_Spell School 06': 'divination',
