    'SpellSheet1_Spell Name 01': 'Minor Illusion',
    'SpellSheet 1_Spells Level 01': '0',
    'SpellSheet1_Spell School 01': 'illusion',
    'SpellSheet1_Range 01': "30'",
    'SpellSheet1_Casting Time 01': '1 action',
    'SpellSheet1_Ritual 01': 'Off',
    'SpellSheet1_Save 01': 'Investigation',
    'SpellSheet1_Duration 01': '1 min',
    'SpellSheet1_Concentration 01': 'Off',
    'SpellSheet1_Components 01': '',
    'SpellSheet1_Verbal 01': 'Off',
    'SpellSheet1_Somatic 01': 'Yes',
    'SpellSheet1_Material 01': 'Off',
    'SpellSheet1_Prepared 01': 'Yes',
    'SpellSheet1_Spell Effect 01':
      'You create a sound or an image of an object within range that lasts for the duration. The illusion also ends if you dismiss it as an action or cast this spell again.\nIf you create a sound, its volume can range from a whisper to a scream. It can be your voice, someone elses voice, a lions roar, a beating o f drums, or any other sound you choose. The sound continues unabated throughout the duration, or you can make discrete sounds at different times before the spell ends.\nIf you create an image of an object -- such as a chair, muddy footprints, or a small chestit must be no larger than a 5-foot cube. The image cant create sound, light, smell, or any other sensory effect. Physical interaction with the image reveals it to be an illusion, because things can pass through it.\nIf a creature uses its action to examine the sound or image, the creature can determine that it is an illusion with a successful Intelligence (Investigation) check against your spell save DC. If a creature discerns the illusion for what it is, the illusion becomes faint to the creature',
    'SpellSheet1_Spell Name 02': 'Thaumaturgy',
    'SpellSheet 1_Spells Level 02': '0',
    'SpellSheet1_Spell School 02': 'transmutation',
    'SpellSheet1_Range 02': "30'",
    'SpellSheet1_Casting Time 02': '1 action',
    'SpellSheet1_Ritual 02': 'Off',
    'SpellSheet1_Save 02': '-',
    'SpellSheet1_Duration 02': 'up to 1 min',
    'SpellSheet1_Concentration 02': 'Off',
    'SpellSheet1_Component 02': '',
    'SpellSheet1_Verbal 02': 'Yes',
    'SpellSheet1_Somatic 02': 'Off',
    'SpellSheet1_Material 02': 'Off',
    'SpellSheet1_Prepared 02': 'Yes',
    'SpellSheet1_Spell Effect 02':
      'You manifest a sign of supernatural power, within range. You create one of the following magical effects within range:\n* Your voice booms up to three times as loud as normal for 1 minute\n* Cause flames to flicker, brighten, dim, or change color for 1 minute.\n* Cause harmless tremors in the ground for 1 minute\n* Create an instantaneous sound that originates from a point o f your choice within range\n* IIstantaneously cause an unlocked door or window to fly open or slam shut.\n* Alter the appearance of your eyes for 1 minute.\nIf you cast this spell multiple times, you can have up to three o f its 1-minute effects active at a time, and you can dismiss such an effect as an action',
    'SpellSheet1_Spell Name 03': 'Darkness',
    'SpellSheet 1_Spells Level 03': '2',
    'SpellSheet1_Spell School 03': 'evocation',
    'SpellSheet1_Range 03': "60'",
    'SpellSheet1_Casting Time 03': '1 action',
    'SpellSheet1_Ritual 03': 'Off',
    'SpellSheet1_Save 03': '-',
    'SpellSheet1_Duration 03': '10 min',
    'SpellSheet1_Concentration 03': 'Yes',
    'SpellSheet1_Components 03': '',
    'SpellSheet1_Verbal 03': 'Yes',
    'SpellSheet1_Somatic 03': 'Off',
    'SpellSheet1_Material 03': 'Off',
    'SpellSheet1_Prepared 03': 'Yes',
    'SpellSheet1_Spell Effect 03':
      'Magical darkness spreads from a point you choose within range to fill a 15-foot-radius sphere for the duration. The darkness spreads around corners. A creature with darkvision cant see through this darkness, and nonmagical light cant illuminate it.\nIf the point you choose is on an object you are holding or one that isnt being worn or carried, the darkness emanates from the object and moves with it. Completely covering the source of the darkness with an opaque object, such as a bowl or a helm, blocks the darkness.\nIf any of this spells area overlaps with an area of light created by a spell of 2nd level or lower, the spell that created the light is dispelled.',
    'SpellSheet1_Spell Name 04': 'Darkvision',
    'SpellSheet 1_Spells Level 04': '2',
    'SpellSheet1_Spell School 04': 'transmutation',
    'SpellSheet1_Range 04': 'touch',
    'SpellSheet1_Casting Time 04': '1 action',
    'SpellSheet1_Ritual 04': 'Off',
    'SpellSheet1_Save 04': '-',
    'SpellSheet1_Duration 04': '8 hours',
    'SpellSheet1_Concentration 04': 'Off',
    'SpellSheet1_Components 04': '',
    'SpellSheet1_Verbal 04': 'Yes',
    'SpellSheet1_Somatic 04': 'Yes',
    'SpellSheet1_Material 04': 'Off',
    'SpellSheet1_Prepared 04': 'Yes',
    'SpellSheet1_Spell Effect 04':
      'You touch a willing creature to grant it the ability to see in the dark. For the duration, that creature has darkvision out to a range of 60 feet.',
    'SpellSheet1_Spell Name 05': 'Pass Without Trace',
    'SpellSheet 1_Spells Level 05': '2',
    'SpellSheet1_Spell School 05': 'abjuration',
    'SpellSheet1_Range 05': 'self',
    'SpellSheet1_Casting Time 05': '1 action',
    'SpellSheet1_Ritual 05': 'Off',
    'SpellSheet1_Save 05': '-',
    'SpellSheet1_Duration 05': '1 hour',
    'SpellSheet1_Concentration 05': 'Yes',
    'SpellSheet1_Components 05': '',
    'SpellSheet1_Verbal 05': 'Yes',
    'SpellSheet1_Somatic 05': 'Yes',
    'SpellSheet1_Material 05': 'Off',
    'SpellSheet1_Prepared 05': 'Yes',
    'SpellSheet1_Spell Effect 05':
      "A veil o f shadows and silence radiates from you, masking you and your companions from detection. For the duration, each creature you choose within 30 feet of you (including you) has a +10 bonus to Dexterity (Stealth) checks and can't be tracked except by magical means. A creature that receives this bonus leaves behind no tracks or other traces of its passage.",
    'SpellSheet1_Spell Name 06': 'Silence',
    'SpellSheet 1_Spells Level 06': 2,
    'SpellSheet1_Spell School 06': 'illusion',
    'SpellSheet1_Range 06': "120'",
    'SpellSheet1_Casting Time 06': '1 action',
    'SpellSheet1_Ritual 06': 'Off',
    'SpellSheet1_Save 06': '-',
    'SpellSheet1_Duration 06': '10 min',
    'SpellSheet1_Concentration 06': 'Yes',
    'SpellSheet1_Components 06': '',
    'SpellSheet1_Verbal 06': 'Yes',
    'SpellSheet1_Somatic 06': 'Yes',
    'SpellSheet1_Material 06': 'Off',
    'SpellSheet1_Prepared 06': 'Yes',
    'SpellSheet1_Spell Effect 06':
      'For the duration, no sound can be created within or pass through a 20-foot-radius sphere centered on a point you choose within range. Any creature or object entirely inside the sphere is immune to thunder damage, and creatures are deafened while entirely inside it. Casting a spell that includes a verbal component is impossible there.',
