    'SpellSheet1_Somatic 08': 'Yes',
    'SpellSheet1_Material 08': 'Yes',
    'SpellSheet1_Prepared 08': 'Yes',
    'SpellSheet1_Spell Effect 08':
      'A creature of your choice that you can see within range perceives everything as hilariously funny and falls into fits of laughter if this spell affects it. The target must succeed on a Wisdom saving throw or fall prone, becoming incapacitated and unable to stand up for the duration. A creature with an Intelligence score of 4 or less isnt affected.\nAt the end of each of its turns, and each time it takes damage, the target can make another Wisdom saving throw. The target has advantage on the saving throw if its triggered by damage. On a success, the spell ends.',
    'SpellSheet1_Spell Name 09': 'Witch Bolt',
    'SpellSheet 1_Spells Level 09': 1,
    'SpellSheet1_Spell School 09': 'evocation',
    'SpellSheet1_Range 09': "30'",
    'SpellSheet1_Casting Time 09': '1 action',
